window.bookSummaryJSON = "<p>When Gwynne Hartley woke up, she assumed it was going to be another boring day in her small town of Olessa. What she didn't know was that she would be accidentally exposed to magic that would forever change her life. From this awakening, she is no longer just a young girl living with her mother.&nbsp;</p> <p>She is now the Oracle of Valemir, a powerful force of nature that has been considered dead for over 1000 years. And now, The Ancient Eri'Dorian Knights of the Order of Valemir must find their deity. Unfortunately, power attracts everyone from werewolves, vampire kings, to criminal assassins, and they too wish to find the new Oracle.&nbsp;</p>"; 
